package com.pojo;

public class TeacherForm {
	private int teacher_number;
	private int zhuanye_id;
	private String teacher_name;
	private String teacher_sex;
	private String teacher_password;
	private String teacher_remarks;
	public TeacherForm() {
		super();
		// TODO Auto-generated constructor stub
	}
	public int getTeacher_number() {
		return teacher_number;
	}
	public void setTeacher_number(int teacher_number) {
		this.teacher_number = teacher_number;
	}
	
	public int getZhuanye_id() {
		return zhuanye_id;
	}
	public void setZhuanye_id(int zhuanye_id) {
		this.zhuanye_id = zhuanye_id;
	}
	public String getTeacher_name() {
		return teacher_name;
	}
	public void setTeacher_name(String teacher_name) {
		this.teacher_name = teacher_name;
	}
	public String getTeacher_sex() {
		return teacher_sex;
	}
	public void setTeacher_sex(String teacher_sex) {
		this.teacher_sex = teacher_sex;
	}
	public String getTeacher_password() {
		return teacher_password;
	}
	public void setTeacher_password(String teacher_password) {
		this.teacher_password = teacher_password;
	}
	public String getTeacher_remarks() {
		return teacher_remarks;
	}
	public void setTeacher_remarks(String teacher_remarks) {
		this.teacher_remarks = teacher_remarks;
	}
	
}
